classdef EKF<handle

    properties
        x; % filter of the state
        xp; % parameters
        P; % covariance matrix state of estimation errors
        Param_cov; % Covariance matrix param of estimation errors
        weight; % weight of EKF instance
        weight_history; % history of the weights of the EKF instance
        state_history; % history of the state
        innovation_history; % history of innovations
        dT; % time integration step
    end


    methods
        
        
        function obj = EKF()
            obj.x = zeros(24,1);
            obj.xp = zeros(3,1);
            obj.P = zeros(24,24);
            obj.Param_cov = zeros(3,3);
            obj.weight = 0;
            obj.weight_history=[];
            obj.state_history=[];
            obj.innovation_history=[];
            obj.dT = 0;
        end


        function EKF_init(obj,phi_0,n,lambda,sigma_phi,weight_init,robot_state,robot_cov_matrix,param_init,param_cov_matrix,dt)

            obj.dT = dt;

            K = (2*pi)/lambda;
            ro_0 = -phi_0/(2*K) + (n*lambda)/2;
            betadist_0 = 0;
            
            % Initialize state vehicle
            v_x0 = robot_state(1);
            v_y0 = robot_state(2);
            psi_dot0 = robot_state(3);
            a_y0 = robot_state(4);
            gamma0 = robot_state(5);
            beta0 = robot_state(6);
            a_x0 = robot_state(7);
            alpha_fl0 = robot_state(8);
            alpha_fr0 = robot_state(9);
            alpha_rl0 = robot_state(10);
            alpha_rr0 = robot_state(11);
            F_zfl0 = robot_state(12);
            F_zfr0 = robot_state(13);
            F_zrl0 = robot_state(14);
            F_zrr0 = robot_state(15);
            s_fl0 = robot_state(16);
            s_fr0 = robot_state(17);
            s_rl0 = robot_state(18);
            s_rr0 = robot_state(19);
            phi0 = robot_state(20);
            phi_dot0 = robot_state(21);
            a_ysens0 = robot_state(22);

            obj.x = [ro_0,betadist_0,v_x0,v_y0,psi_dot0,a_y0,gamma0,beta0,a_x0,alpha_fl0,alpha_fr0,alpha_rl0,alpha_rr0,F_zfl0,F_zfr0,F_zrl0,...
                F_zrr0,s_fl0,s_fr0,s_rl0,s_rr0,phi0,phi_dot0,a_ysens0];

            sigma_rho = sigma_phi/(2*K);
            obj.P(1,1) = sigma_rho^2;
            obj.P(2,2) = (pi/3)^2;

            for i=3:length(obj.x)
                for j = 3:length(obj.x)
           
                        obj.P(i,j) = robot_cov_matrix(i-2,j-2); % obj.P(3,3) = robot_cov_matrix(1,1); obj.P(3,4) = robot_cov_matrix(1,2),...; 

                end
            end

            % Initialize parameter
            m0 = param_init(1);
            Jz0 = param_init(2);
            b0 = param_init(3);

            obj.xp=[m0,Jz0,b0];

            for i=1:lengtt(obj.xp)
                for j=1:length(obj.xp)
                    obj.Param_cov(i,j) = param_cov_matrix(i,j); % 3*3 matrix
                end
            end


            obj.weight = weight_init;
            obj.weight_history = [obj.weight_history; obj.weight];

        end


        % Function that computes the prediction step of state and
        % parameters
        function EKF_prediction(obj,measurements_readings,u)

            delta = u(1);
            w_fl = u(2);
            w_fr = u(3);
            w_rl = u(4);
            w_rr = u(5);


            % Measurements
            psi_dot_curr = measurements_readings{1,1}(1);
            a_ysens_curr = measurements_readings{1,1}(2);
            v_x_curr = measurements_readings{1,1}(3);

            % Current states
            rho_curr = obj.x(1);
            betadist_curr = obj.x(2);

            v_y_curr = obj.x(4);
            a_y_curr = obj.x(6);
            Gamma_curr = obj.x(7);
            beta_curr = obj.x(8);
            a_x_curr = obj.x(9);
            alpha_fl_curr = obj.x(10);
            alpha_fr_curr = obj.x(11);
            alpha_rl_curr = obj.x(12);
            alpha_rr_curr = obj.x(13);
            F_zfl_curr = obj.x(14);
            F_zfr_curr = obj.x(15);
            F_zrl_curr = obj.x(16);
            F_zrr_curr = obj.x(17);
            s_fl_curr = obj.x(18);
            s_fr_curr = obj.x(19);
            s_rl_curr = obj.x(20);
            s_rr_curr = obj.x(21);
            phi_curr = obj.x(22);
            phi_dot_curr = obj.x(23);

            % Current covariance state estimation errors
            P_curr = obj.P;

            % Current parameters
            m_curr = obj.xp(1);
            Jz_curr = obj.xp(2);
            b_curr = obj.xp(3);

            % Current covariance parameter estimations errors
            Param_cov_curr = obj.Param_cov;

            %% PREDICTION STEP
            % STATE DYNAMICS

            rho_next = rho_curr - v_x_curr*obj.dT*cos(betadist_curr);
            betadist_next = beta_dist_curr + psi_dot_curr + (v_x_curr*obj.dT/rho_curr)*sin(betadist_curr);

            v_x_next = v_x_curr + obj.dT*(a_x_curr + v_y_curr*psi_dot_curr);
            v_y_next = v_y_curr + obj.dT*(a_y_curr - v_x_curr*psi_dot_curr);
            psi_dot_next = psi_dot_curr + obj.dT*Gamma_curr/Jz_curr;
            a_y_next = 1/m_curr*(F_yfl*cos(delta) + F_xfl*sin(delta) + F_yfr*cos(delta) + F_xfr*sin(delta) + F_yrl + F_yrr);
            Gamma_next =  tr/2*F_xrl - tr/2*F_xrr - (l - b_curr) * F_yrl - (l - b_curr)*F_yrr;
            beta_next = atan2(v_y_curr, v_x_curr);
            a_x_next = 1/m_curr*(F_xfl*cos(delta) - F_yfl*sin(delta) + F_xfr*cos(delta) - F_yfr*sin(delta) + F_xrl + F_xrr);
            alpha_fl_next = delta - atan2((v_y_curr + b_curr*psi_dot_curr), (v_x_curr + tf*psi_dot_curr/2));
            alpha_fr_next = delta - atan2((v_y_curr + b_curr*psi_dot_curr), (v_x_curr - tf*psi_dot_curr/2));
            alpha_rl_next = atan2((-v_y_curr + (l - b_curr)*psi_dot_curr), (v_x_curr + tr*psi_dot_curr/2));
            alpha_rr_next = atan2((-v_y_curr + (l - b_curr)*psi_dot_curr), (v_x_curr - tr*psi_dot_curr/2));
            F_zfl_next = (1/2*m_curr*g + m_curr*a_y_curr*h/tf)*(l - b_curr)/l - 1/2*m_curr*a_x_curr*h/l;
            F_zfr_next = (1/2*m_curr*g - m_curr*a_y_curr*h/tf)*(l - b_curr)/l - 1/2*m_curr*a_x_curr*h/l;
            F_zrl_next = (1/2*m_curr*g + m_curr*a_y_curr*h/tr)*b_curr/l + 1/2*m_curr*a_x_curr*h/l;
            F_zrr_next = (1/2*m_curr*g - m_curr*a_y_curr*h/tr)*b_curr/l + 1/2*m_curr*a_x_curr*h/l;
            s_fl_next = s_fl_curr;
            s_fr_next = s_fr_curr;
            s_rl_next = s_rl_curr;
            s_rr_next = s_rr_curr;
            phi_next = phi_curr + obj.dT*phi_dot_curr;
            phi_dot_next = phi_dot_curr + obj.dT/Jsx*(-ms*hs*a_y_curr + phi_curr*(ms*g*hs - k_phi) - phi_dot_curr*beta_phi);
            a_y_sens_next = (a_y_curr + Gamma_curr/Jz_curr*(b_curr - ba) + 1/Jsx*(-ms*hs*a_y_curr + phi_curr*(ms*g*hs - k_phi) - phi_dot_curr*beta_phi)*h_z) + g*phi_curr;


            obj.x = [rho_next,betadist_next,v_x_next,v_y_next,psi_dot_next,a_y_next,Gamma_next,beta_next,a_x_next,alpha_fl_next,alpha_fr_next,alpha_rl_next,alpha_rr_next,...
                F_zfl_next,F_zfr_next,F_zrl_next,F_zrr_next,s_fl_next,s_fr_next,s_rl_next,s_rr_next,phi_next,phi_dot_next,a_y_sens_next];


            
            % Parameter dynamics
            m_next = m_curr;
            Jz_next = Jz_curr;
            b_next = b_curr;

            obj.xp = [m_next,Jz_next,b_next];

            %% JACOBIAN OF STATE

            % Rename the variables becuase it is useful for jacobian
            % definition

            psi_dot = psi_dot_curr;
            a_ysens=  a_ysens_curr;
            v_x = v_x_curr;
            
            v_y = v_y_curr;
            a_y = a_y_curr;
            Gamma = Gamma_curr; 
            beta = beta_curr; 
            a_x = a_x_curr;
            alpha_fl = alpha_fl_curr; 
            alpha_fr = alpha_fr_curr;
            alpha_rl = alpha_rl_curr;
            alpha_rr =  alpha_rr_curr;
            F_zfl = F_zfl_curr ;
            F_zfr = F_zfr_curr ;
            F_z_rl = F_zrl_curr ;
            F_zrr = F_zrr_curr ;
            s_fl = s_fl_curr ;
            s_fr = s_fr_curr ;
            s_rl = s_rl_curr ;
            s_rr = s_rr_curr ;
            phi = phi_curr ;
            phi_dot = phi_dot_curr ;

            Dt = obj.dT;
            m = m_curr;
            Jz = Jz_curr;
            b = b_curr;



            % Jacobian of state dynamics
            
            % Jacobian respect to rho and betadist 2*2 first part
            A = zeros(2,2);
            A(1,1) = 1;
            A(1,2) = v_x*Dt*sin(betadist_curr);
            A(2,1) = - v_x*Dt/(rho_curr)^2 *sin(betadist_curr);
            A(2,2) = 1 + (v_x*Dt/rho_curr)*cos(betadist_curr);

           

            % Jacobian respect to state vehicle
            B =[                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                