        J_s(1,3) = - Dt*cos(betadist_curr);
        J_s(2,3) = (Dt/rho_curr)*sin(betadist_curr);
        J_s(2,5) = 1;

        %% PREDICTION STEP COVARIANCE
        % State
        R0 = 1e4;
        R_s = R0.*eye(24);    % user specificed noise covariance matrix for state estimation
        P_next = J_s*P_curr*J_s' + R_s;
        obj.P = P_next;

        % Parameters
        R_p = diag([(0.01*m_curr)^2 (0.01*Jz_curr)^2  (0.01*b_curr)^2]); % user specified noise covariance matrix for parameter estimation
        Param_cov_next = Param_cov_curr + R_p;
        obj.Param_cov = Param_cov_next;

        end


        % Function that does the correction step of the filter
        function EKF_correction(obj,K,measurement_readings,sigma_phi,sigma_meas)

            rho_curr = obj.x(1);
            psi_dot_curr = obj.x(5);
            a_y_sens_curr = obj.x(6);
            v_x_curr = obj.x(3);

            psi_dot_meas = measurement_readings(1);
            a_y_sens_meas = measurement_readings(2);
            v_x_meas = measurement_readings(3);
            phi_meas = measurement_readings(4);

            P_curr = obj.P;
            R = diag([sigma_meas^2 sigma_meas^2 sigma_meas^2  sigma_phi^2]); % Measurement noise covariance matrix

            % Jacobian matrix of output
            H = zeros(4,24);
            H(1,3)  = 1;
            H(2,24) = 1;
            H(3,1)  = 1;
            H(4,1)  = -2*K;

            Kalman_gain = P_curr*H'*pinv(H*P_curr*H'+R);

            phi_expected = mod(-2*K*rho_curr,2*pi);

            % Calculation of innovation
            innovation = [psi_dot_meas-psi_dot_curr,a_y_sens_meas-a_y_sens_curr,v_x_meas-v_x_curr,phi_meas - phi_expected]';
            innovation(4) = atan2(sin(innovation(4)),cos(innovation(4)));

            obj.innovation_history = [obj.innovation_history;innovation];

            state_next = obj.x + Kalman_gain*innovation;

            P_next = (eye(24)-Kalman_gain*H)*P_curr;

            % Update the weight
            obj.weight = obj.weight*exp(-0.5*innovation^2/(H*P_next*H'+R));
            obj.weight_history = [obj.weight_history;obj.weight];

            rho_next = state_next(1);
            betadist_next = state_next(2);
            v_x_next = state_next(3);
            v_y_next = state_next(4);
            psi_dot_next = state_next(5);
            a_y_next = state_next(6);
            Gamma_next =  state_next(7);
            beta_next = state_next(8);
            a_x_next = state_next(9);
            alpha_fl_next = state_next(10);
            alpha_fr_next = state_next(11);
            alpha_rl_next = state_next(12);
            alpha_rr_next =state_next(13);
            F_zfl_next = state_next(14);
            F_zfr_next = state_next(15);
            F_zrl_next = state_next(16);
            F_zrr_next =state_next(17);
            s_fl_next = state_next(18);
            s_fr_next = state_next(19);
            s_rl_next = state_next(20);
            s_rr_next = state_next(21);
            phi_next = state_next(22);
            phi_dot_next = state_next(23);
            a_y_sens_next = state_next(24);
            
        

            obj.x = [rho_next,betadist_next,v_x_next,v_y_next,psi_dot_next,a_y_next,Gamma_next,beta_next,a_x_next,alpha_fl_next,alpha_fr_next,alpha_rl_next,...
                alpha_rr_next,F_zfl_next,F_zfr_next,F_zrl_next,F_zrr_next,s_fl_next,s_fr_next,s_rl_next,s_rr_next,phi_next,phi_dot_next,a_y_sens_next];

            obj.P = P_next;


        end
        

        function weight_tmp = EKF_weight_tmp(obj,k,odometry_history,phase_history,Ns,weight_prec,c1,c2,K,l)

            sum_phase_diff=0;

            for i= (k-Ns+1):(k-1)
                for i = (k-Ns+1) : (k-1)
    
            x_tag =  odometry_history{i,1}(1) + obj.state_history{i,1}(1)*cos(odometry_history{i,1}(3) - obj.state_history{i,1}(2));
            y_tag =  odometry_history{i,1}(2) + obj.state_history{i,1}(1)*sin(odometry_history{i,1}(3) - obj.state_history{i,1}(2));
     
    
                 if i == (k-Ns+1)
                    x_min_tag = x_tag;
                    y_min_tag = y_tag;
                    x_max_tag = x_tag;
                    y_max_tag = y_tag;
                 end
     
                 if x_tag < x_min_tag
                    x_min_tag = x_tag;
                end
                if y_tag < y_min_tag
                     y_min_tag = y_tag;
                end
                if x_tag > x_max_tag
                     x_max_tag = x_tag;
                end
                if y_tag > y_max_tag
                     y_max_tag = y_tag;
                end
     
                D = sqrt((odometry_history{i,1}(1) - x_tag)^2 + (odometry_history{i,1}(2) - y_tag)^2);
                phi_expected = mod(-2*K*D,2*pi);
     
                phase_diff = (phase_history(i) - phi_expected)^2;
     
                sum_phase_diff = sum_phase_diff + phase_diff;
     
             end
     
            M1 = 1/(1 + sqrt((x_max_tag - x_min_tag)^2 + (y_max_tag - y_min_tag)^2));
     
            M2 = 1/sqrt(sum_phase_diff);
     
         % Print x_max_tag, x_min_tag, y_max_tag, y_min_tag, phi_expected
         % fprintf('EKF INSTANCE: %d \n',l);
         % fprintf('x_max_tag = %f, x_min_tag = %f, y_max_tag = %f, y_min_tag = %f \n',x_max_tag, x_min_tag, y_max_tag, y_min_tag);
         % fprintf('D: %f, -2*K*D: %f, Phi expected = %f\n',D, -2*K*D, phi_expected);
     
            weight_tmp = weight_prec + c1*M1 + c2*M2; 


            end
        end


